import React, { Component } from 'react';
import { BrowserRouter as Router, Switch, Route } from 'react-router-dom';
import Home from './containers/Home.js'

class App extends Component {
  render() {
    return (
      <Router>
        <h1>LandLords App</h1>
        <div className="App">
          <Switch>
            <Route exact path="/" component={Home} />
          </Switch>

        </div>

      </Router>

    );
  }

}

export default App;
